import React, { useEffect, useState } from "react";

const Team = () => {
  const [teamMembers, setTeamMembers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchTeamData = async () => {
      try {
        // Fetch team data from API
        const response = await fetch("http://localhost:3000/api/team");
        if (!response.ok) {
          throw new Error("Failed to fetch team data");
        }
        const data = await response.json();
        setTeamMembers(data.members); // assuming the API response contains a 'members' array

        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };

    fetchTeamData();
  }, []);

  if (loading) return <div>Loading team data...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="team-wrapper">
      <div className="container">
        <h2 className="section-title">Meet Our Team</h2>
        <div className="grid grid-cols-12 gap-6">
          {teamMembers.map((member) => (
            <div key={member.id} className="col-span-12 md:col-span-4">
              <div className="team-member-card">
                <img
                  src={member.avatar}
                  alt={member.name}
                  className="w-full h-auto rounded-lg mb-4"
                />
                <h3 className="text-xl font-semibold">{member.name}</h3>
                <p className="text-gray-600">{member.position}</p>
                <p className="mt-4">{member.bio}</p>
                <div className="social-links mt-4">
                  {member.socials.map((social, index) => (
                    <a
                      key={index}
                      href={social.link}
                      className="text-primary mr-4"
                      target="_blank"
                      rel="noopener noreferrer"
                    >
                      {social.icon}
                    </a>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Team;
